import "./UserCard.css";

const UserCard = ({ avatar_url, name, login }) => {
  return (
    <div className="card">
      <img
        className="usercard__avatar"
        src={avatar_url}
        alt={`Foto de perfil de ${name}`}
      />
      <p>@{login}</p>
    </div>
  );
};

export default UserCard;
